import { Div, Label } from './Form.styled';

const Form = ({ state, onChange }) => {
  return (
    <Div>
      <h3>Leave your contact</h3>
      <Label>
        {' '}
        Name
        <input required name="name" value={state.name} onChange={onChange} />
      </Label>
      <Label>
        {' '}
        Email
        <input required name="email" value={state.email} onChange={onChange} />
      </Label>
      <Label>
        {' '}
        Phone
        <input required name="phone" value={state.phone} onChange={onChange} />
      </Label>
      <Label>
        {' '}
        Address
        <input
          required
          name="address"
          value={state.address}
          onChange={onChange}
        />
      </Label>
    </Div>
  );
};
export default Form;
